import React from 'react';
import {Col, Row} from "react-bootstrap";

function AppGrid(props) {
    return (
        <Row className="justify-content-md-center">
            <Col xs lg="2">
                1 of 3
            </Col>
            <Col md="auto">Variable width content</Col>
            <Col xs lg="2">
                3 of 3
            </Col>
        </Row>
    );
}

export default AppGrid;
